    mediaBox: {
        display: 'flex',
        justifyContent: 'space-between',
        width: '80%',
    },

    root: {
        width: '500px',
        margin: 'auto',
        height: '400px',
        boxShadow: 'unset',
        borderRadius: '10px'
    },
    media: {
        height: '100%',
        backgroundPosition: 'bottom'
    },

    bottomPara: {
       
        fontSize: '30px',
        textAlign: 'left',
      
        fontStyle: 'italic'
    },
    bottomBox:{
        display: 'block',
    width: '40%',
    margin: 'auto',
    },

    paraName : {
        margin: 0,
    textAlign: 'left',
    fontStyle: 'italic',
    }
});

export default function FourthSection() {
    const classes = useStyles();

    return (
        <div className={classes.Main}>
            <Box className={classes.paraBox}>
                <p className={classes.para}>What our students have to say</p>
            </Box>
            <Box className={classes.mediaBox}>
                <Card className={classes.root}>
                    <CardMedia
                        className={classes.media}
                        image={Think}
                        title="Image"
                    />
                </Card>
                <Box className = {classes.bottomBox}>
                    <p className={classes.bottomPara}>Skillfy is a life saver. I donâ€™t have the
time money for a college education. My goal is to become a freelance web designer and thanks to Skillfy.</p>
                    <p className = {classes.paraName}>Riaz Surti | Hearthy Foods</p>
                </Box>
            </Box>
        </div>

    );
}
